describe("StrStr", function() {
  var StrStr = require('../lib/StrStr');
  var solution;

  beforeEach(function() {
    solution = new StrStr();
  });

  it("should return 0 on empty string arguments", function() {
    expect(solution.strStr('', '')).toEqual(0);
  });

  it("should return 0 on empty string arguments", function() {
    expect(solution.strStr('', 'a')).toEqual(0);
  });

  it("should return find substring", function() {
    expect(solution.strStr('haystack', 'stack')).toEqual(3);
  });

  it("should return first substring appearance", function() {
    expect(solution.strStr('haystackstack', 'stack')).toEqual(3);
  });

  it("should return -1 if not found", function() {
    expect(solution.strStr('iddqd', 'x')).toEqual(-1);
  });

  it("should be able to run fast on large input strings", function() {
    expect(solution.strStr("", "")).toEqual(-1);
  });
});
